using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Text.RegularExpressions;
using System.Threading.Tasks;
using System.Windows;
using System.Windows.Controls;
using System.Windows.Data;
using System.Windows.Documents;
using System.Windows.Input;
using System.Windows.Media;
using System.Windows.Media.Imaging;
using System.Windows.Navigation;
using System.Windows.Shapes;

namespace DecodageBase64WPF
{
    /// <summary>
    /// Logique d'interaction pour MainWindow.xaml
    /// </summary>
    public partial class MainWindow : Window
    {
        public MainWindow()
        {
            InitializeComponent();
        }

        private void Window_Loaded(object sender, RoutedEventArgs e)
        {
            NouveauDecodage();
        }

        /// <summary>
        /// 
        /// </summary>
        void NouveauDecodage()
        {
            tbInfo.Foreground = Brushes.Green;
        }

        /// <summary>
        /// 
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btVider_Click(object sender, RoutedEventArgs e)
        {
            tbChaine.Text = "";
            tbDecode.Text = "";
            tbInfo.Text = "";
        }

        /// <summary>
        /// 
        /// </summary>
        /// <param name="sender"></param>
        /// <param name="e"></param>
        private void btDecoder_Click(object sender, RoutedEventArgs e)
        {
            string base64Encoded = PickASring();
            if (base64Encoded != null)
            {
                DecodageBase64(base64Encoded);
            }
        }

        /// <summary>
        /// 
        /// </summary>
        /// <returns></returns>
        string PickASring()
        {

            string picked = tbChaine.Text;
            //string picked = "YmFzZTY0IGVuY29kZWQgc3RyaW5n";
            //string picked = "";


            if (picked.Equals(""))
            {
                tbInfo.Text = "La chaine est vide ... ";
                tbInfo.Foreground = Brushes.Red;
                return null;
            }

            //if (!Regex.IsMatch(noOffreRecherche, "^[a-zA-Z]{0,1}\\d{0,10}$"))
            if (!Regex.IsMatch(picked, "^(?:[A-Za-z0-9+/]{4})*(?:[A-Za-z0-9+/]{2}==|[A-Za-z0-9+/]{3}=)?$"))
            {
                tbInfo.Text = "Ceci n'est pas un chaine en base64 ... ";
                tbInfo.Foreground = Brushes.Red;
                return null;
            }

            else
            {
                tbInfo.Text = "";
            }

            return picked;
        }

        void Fin()
        {
            tbInfo.Foreground = Brushes.Green;
            tbInfo.Text = "Chaine décodée";
        }

        /// <summary>
        /// 
        /// </summary>
        void DecodageBase64(string base64Encoded)
        {

            string base64Decoded;
            byte[] data = System.Convert.FromBase64String(base64Encoded);
            base64Decoded = System.Text.ASCIIEncoding.ASCII.GetString(data);

            tbDecode.Text = base64Decoded;

            Fin();
        }

        
    }
}
